// Next.js API route support: https://nextjs.org/docs/api-routes/introduction

export default (req, res) => {
    res.statusCode = 200

    const url = "https://www.notion.so/dianait/Blog-con-Next-js-6a271f2789824c69ada2a05974508da6";
    const html = "";

    fetch(url).then(resp=> resp.text()).then(body => html = body) ;

    res.json({ html })
  }
